import React, { useState } from "react";
import axios from "axios";
import UploadBox from "./components/UploadBox";

const BACKEND = "http://127.0.0.1:8000"; // Backend FastAPI URL

export default function App() {
  const [summary, setSummary] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const handleUpload = async (file) => {
    setError("");
    setLoading(true);
    setSummary(null);

    try {
      const formData = new FormData();
      formData.append("file", file);

      const res = await axios.post(`${BACKEND}/upload`, formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });

      const data = res.data;
      if (data.download_url && data.download_url.startsWith("/")) {
        data.download_url = BACKEND + data.download_url;
      }
      setSummary(data);
    } catch (err) {
      console.error(err);
      setError(err?.response?.data?.detail || "Error processing PDF.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ maxWidth: 900, margin: "40px auto", padding: "20px", fontFamily: "Arial" }}>
      <h1>📄 PDF DataClean Analyzer</h1>
      <p>Upload a PDF with tables. We'll extract, clean, and show results!</p>

      <UploadBox onUpload={handleUpload} loading={loading} />

      {loading && <p style={{ color: "#888" }}>Processing PDF... please wait.</p>}
      {error && <p style={{ color: "red" }}>{error}</p>}

      {summary && (
        <div style={{ marginTop: 20 }}>
          <h2>Summary</h2>
          <ul>
            <li><b>Total Rows:</b> {summary.total_rows ?? "N/A"}</li>
            <li><b>Cleaned Rows:</b> {summary.cleaned_rows ?? "N/A"}</li>
            <li><b>Missing Values:</b> {summary.missing_values ?? "N/A"}</li>
            <li>
              <b>Columns:</b>{" "}
              {Array.isArray(summary.columns)
                ? summary.columns.join(", ")
                : "No columns found"}
            </li>
          </ul>

          <h3>Data Preview</h3>
          <div style={{ overflowX: "auto" }}>
            <table
              border="1"
              cellPadding="6"
              cellSpacing="0"
              style={{ width: "100%", borderCollapse: "collapse" }}
            >
              {Array.isArray(summary.columns) && Array.isArray(summary.sample_data) ? (
                <>
                  <thead>
                    <tr>
                      {summary.columns.map((c) => (
                        <th key={c}>{c}</th>
                      ))}
                    </tr>
                  </thead>
                  <tbody>
                    {summary.sample_data.map((row, i) => (
                      <tr key={i}>
                        {summary.columns.map((c) => (
                          <td key={c}>{row[c] ?? ""}</td>
                        ))}
                      </tr>
                    ))}
                  </tbody>
                </>
              ) : (
                <tbody>
                  <tr>
                    <td colSpan="100%">No data to display</td>
                  </tr>
                </tbody>
              )}
            </table>
          </div>

          {summary.download_url && (
            <div style={{ marginTop: 15 }}>
              <a href={summary.download_url} target="_blank" rel="noreferrer">
                <button style={{ padding: "8px 12px", cursor: "pointer" }}>
                  Download Cleaned CSV
                </button>
              </a>
            </div>
          )}
        </div>
      )}
    </div>
  );
}
